import React from "react";
import { Carousel } from "react-responsive-carousel";
import meuble1 from "../../assets/Images/meuble1.png";
import meuble2 from "../../assets/Images/meuble2.png";
import meuble3 from "../../assets/Images/meuble3.png";
import meuble4 from "../../assets/Images/meuble4.png";
import { Item, ImgItem } from "./HeroSlidesElements.js";
import "react-responsive-carousel/lib/styles/carousel.min.css";

export const HeroSlides = () => {
  return (
    <div>
      <HeroSlides>
        <Carousel>
          <Carousel axis="vertical">
            <Item>
              <ImgItem src={meuble1} />
            </Item>
            <Item>
              <ImgItem src={meuble2} />
            </Item>
            <Item>
              <ImgItem src={meuble3} />
            </Item>
            <Item>
              <ImgItem src={meuble4} />
            </Item>
          </Carousel>
        </Carousel>
      </HeroSlides>
    </div>
  );
};

export default HeroSlides;
